// import logo from './logo.svg';
import './App.css';
import Car from './Components/Car';
import Garage from './Components/Garage';


const carinfo = {name: "Ford", model: "Mustang"};

function App() {
  return (
    <div className="App">
     <Garage size = {"small"}/>
     <Car carinfo = {carinfo}/>
    </div>
  );
}

export default App;
